import React from "react";
import Nav from './Nav'
import login_img from './img/login_img.jpeg';
import './Nav.css';
import './Home.css';

const home ={
    backgroundImage: 'url(' + login_img + ')',
    width: '100%',
    height: '100%',
    backgroundRepeat: 'no-repeat',
    backgroundSize: '100% 100%',
}
class Home extends React.Component {
  constructor(props) {
    super(props);

  }
  render() {
    return (
      <div style={home}>
          <Nav/>
            <div class="image">
                <a class="btn" href="/login"><span>Register/Login</span></a>
            </div>
            <div id="about">

                    <div class="row">
                        <div class="about col-lg-6 col-md-6">
                            <div class="pic"></div>
                        </div>

                        <div class="content col-md-offset-6 col-lg-offset-6">
                          <center><h1 class="contentHead">ABOUT ME</h1></center>

                        <h2>Hi Folks, <br/><br/>
                          This is Shaik Maqsood. I'm a Freakin frontend developer, jus came up with this  concept of having a 45 trasformed DIV with a -45 background.<br/><br/>
                          Can't belive that it worked.
                          <br/><br/>
                          Show your LOVE if you like my pen.
                          <br/><br/>
                        </h2>
                      </div>
                    </div>   

            </div>
            <div id="contact">    
            </div>

      </div>
    );
  }
}
export default Home
